import { Footer } from "./project02/footer";
import { Breadcrumb } from "./project02/Breadcrumb";
import { MainContent } from "./project02/Maincontent";
function App() {
  return (
    <>
    <Header/>
    <MainContent/>
    <Breadcrumb/>
    <Footer/>
    </>
  );
}

export default App;
